make";i:0;s:10:"vod_trysee";i:0;s:13:"vod_douban_id";i:0;s:16:"vod_douban_score";s:3:"0.0";s:9:"vod_reurl";s:0:"";s:11:"vod_rel_vod";s:0:"";s:11:"vod_rel_art";s:0:"";s:11:"vod_content";s:1706:"《金家好媳妇》是一部三立台湾台播出的八点档连续剧剧集从11月13日至11月16日定妆，后于三立重整剧本，又于同年12月5日二度定妆，于2017年12月21日开镜，于同年12月21日开拍，同年12月27日举办卡司记者会，拍摄与播出同步进行，将于2018年接档《一家人》。 本剧由新路山传播制作，于每周一至周五晚间八点播出。 　　时代在变，人们的价值观也与时俱进的改变，但改变不了的是人与人之间那永远难以割舍的亲情与爱情。&ldquo;家家有本难念的经&rdquo;，每个家都有必须要面对的课题，而&ldquo;金家&rdquo;的屋簷下，除了不同世代，各式各样的婆媳问题外，金家年轻人们多姿多采的爱情和人生，随着金家一家人所面临的大小事，随着角色的喜怒哀乐而有所共鸣！ 　　婆婆们都期待儿子能娶个金家好媳妇 (真正的好媳妇)，也期待着已娶进门的媳妇们，能够成为真正的好媳妇。新世代的年轻女孩们，面对要不要成为媳妇、到底什么是真的&ldquo;ㄐㄧㄣ ㄐㄧㄚˋ(真正，台语)&rdquo;好媳妇的考验，相信每个看故事的观众，都能够有相当强的邻近感。 金家的故事，就是属于每一人身边的故事，也是属于每一个人的事，不分男女。男人有娶媳妇的课题，女人有要不要进入婚姻的课题，而一旦结了婚，除了体会婚姻的酸与甜，还得面对婆媳、姑嫂、妯娌间的&ldquo;那些小事&rdquo;&hellip;让我们透过金家，去看的深有同感，鼓掌叫好，笑得开心，骂得痛快之余，也透视到家庭与爱情真正爱的真谛！";s:13:"vod_play_from";s:14:"kkyun$$$kkm3u8";s:15:"vod_play_server";s:7:"no$$$no";s:13:"vod_play_note";s:3:"$$$";s:12:"vod_play_url";s:27953:"第01集$https://hao.czybjz.com/share/64Fni5YWY4UADryo#第02集$https://hao.czybjz.com/share/W52WIQQgN9Il3mFE#第03集$https://hao.czybjz.com/share/XlWHAORsMRGsI7t0#第04集$https://video.fjhps.com/share/MplxUphznuCppQ2B#第05集$https://hao.czybjz.com/share/UwY71LuWgOFsgbol#第06集$https://hao.czybjz.com/share/nE1eItvEOXETYMrd#第07集$https://video.fjhps.com/share/AJwtmUPU4R9nE7i9#第10集$https://video.fjhps.com/share/545Sr8SPioc7Mwv8#第11集$https://hao.czybjz.com/share/fCEi2acq8w6H4Obc#第12集$https://hao.czybjz.com/share/EyNsiSHZQkr2t5Gq#第13集$https://video.fjhps.com/share/GfDwpwtI1O0ArCdn#第14集$https://video.fjhps.com/share/TW3gWtb6iSXIadtL#第15集$https://video.fjhps.com/share/hAXgQ4GAGMb6RSQg#第16集$https://video.fjhps.com/share/HxNjpKads2R0J86o#第17集$https://video.fjhps.com/share/XZYKOkMwzMKkLD10#第18集$https://hao.czybjz.com/share/hX0kxlxTg5fKUblM#第19集$https://hao.czybjz.com/share/BXrtkER8qauyOiCo#第20集$https://hao.czybjz.com/share/tnuhEFiGx6CN0s15#第21集$https://video.fjhps.com/share/0ww9WG8oWUlXDq74#第22集$https://video.fjhps.com/share/rOdBxyhknlykm